import React, { Component } from 'react'
import Axios from 'axios'
import { Link, Route, Switch } from 'react-router-dom'
import '../App.css'
export default class Homepage extends Component {
  constructor(props) {
    super(props)
  }
  render() {
    console.log(this.props.data)
    return (
      <div className='cont'>
        {this.props.loading == false ? (
          <div className='row mt-4'>
            {this.props.data.map((song) => {
              return (
                <div className='col-12 col-sm-6  col-md-4 col-lg-3 mb-5'>
                  <div
                    class='card  cardbox'
                    style={{ width: '18em', maxHeight: '100vh' }}
                  >
                    <img
                      class='img-fluid '
                      src={song['im:image'][2].label}
                      alt='...'
                    />
                    <div class='card-body cardbody'>
                      <h5 class='card-title'>{song['im:name'].label}</h5>
                      <p class='card-text'>Artist: {song['im:artist'].label}</p>
                      <p class='card-text'>Artist: {song['im:price'].label}</p>
                      <button onClick={(e) => this.props.addFav(e, song)}>
                        fav
                      </button>
                      <Link
                        to={`song/${song['im:name'].label}`}
                        className='btn btn-dark'
                      >
                        Book Now
                      </Link>
                    </div>
                  </div>
                </div>
              )
            })}
          </div>
        ) : (
          ''
        )}
      </div>
    )
  }
}
